package main

import (
	"fmt"
	"strconv"
	"strings"
)

const input = `



`

const (
	UP    = "U"
	DOWN  = "D"
	LEFT  = "L"
	RIGHT = "R"
	sizeX = 3
	sizeY = 3
)

type player struct {
	pos coord
}

type coord struct {
	x, y int
}

func main() {
	lines := strings.Split(input, "\n")
	p := player{}
	p.pos = coord{1, 1} // Start on number 5

	for _, l := range lines {
		fmt.Print(p.process(l))
	}
}

func (p *player) process(line string) string {
	for _, c := range strings.Split(line, "") {
		p.pos.move(c)
	}
	return posToDigit(p.pos)
}

func posToDigit(pos coord) string {
	return strconv.Itoa(pos.y*3 + (pos.x + 1))
}

func (c *coord) move(dir string) {
	if dir == UP {
		c.y--
		if c.y < 0 {
			c.y = 0
		}
	} else if dir == DOWN {
		c.y++
		if c.y == sizeY {
			c.y = sizeY - 1
		}
	} else if dir == LEFT {
		c.x--
		if c.x < 0 {
			c.x = 0
		}
	} else {
		c.x++
		if c.x == sizeX {
			c.x = sizeX - 1
		}
	}
}
